import React from 'react';
import './_Form.scss';

const FormHead = () => {
    return (
    <header class="header">
        <h2 class="header__title">Never miss a beat</h2>
        <p class="header__description">Subscribe to Slotify today</p>
    </header>
    )
}

export default FormHead;
